        },
        {
          "name": "The Louvre Museum",
          "type": "Cultural",
          "description": "The world's largest art museum and a historic monument, home to thousands of works from various civilizations and eras."
        }
      ]
    },
    {
      "poi_list": [
        {
          "name": "Notre-Dame Cathedral",
          "type": "Historical",
          "description": "A medieval Catholic cathedral on the Île de la Cité in the 4th arrondissement and example of French Gothic architecture."
        },
        {
          "name": "Palais Garnier",
          "type": "Cultural",
          "description": "19th-century opera house commissioned by Emperor Napoleon III and a masterpiece filled with elaborate art and opulent architecture."
        }
      ]
    },
    {
      "poi_list": [
        {
          "name": "Sainte-Chapelle",
          "type": "Historical",
          "description": "A royal chapel within the medieval Palais de la Cité, featuring some of the finest examples of stained-glass windows in the world."
        },
        {
          "name": "Musée d'Orsay",
          "type": "Cultural",
          "description": "Art museum housed in a Beaux-Arts railway station, built between 1898 and 1900, well-known for its extensive collection of impressionist masterpieces."
        }
      ]
    },
    {
      "poi_list": [
        {
          "name": "Montmartre",
          "type": "Cultural",
          "description": "A historic and cultural neighborhood crowned by the 19th-century Basilica of the Sacré-Coeur."
        },
        {
          "name": "Versailles Palace",
          "type": "Historical",
          "description": "A palace built in the 17th century for Louis XIV and a symbol of the absolute monarchy of the Ancien Régime."
        }
      ]
    }
  ]
}
